import React, { useState } from 'react';
import './App.css';

function App() {
  const [file, setFile] = useState(null);
  const [param1, setParam1] = useState('');
  const [param2, setParam2] = useState('');
  const [param3, setParam3] = useState('');
  const [response, setResponse] = useState('');
  const [isLoading, setIsLoading] = useState(false);
    const [additionalParams, setAdditionalParams] = useState('');  // New state for additional parameters



    const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

    const handleSubmit = async () => {
        setIsLoading(true);  // Set loading state to true before making the API call

        const formData = new FormData();
        formData.append('file', file);

        try {
            const res = await fetch(`http://localhost:8080/upload?args=${param1}&args=${param2}&args=${param3}`, {
                method: 'POST',
                body: formData,
            });

            const result = await res.text();
            setResponse(result);
        } catch (error) {
            console.error('Error uploading file:', error);
            setResponse('Error uploading file: ' + error.message);
        } finally {
            setIsLoading(false);  // Set loading state to false after completing the API call
        }
    };

    return (
        <div className="App">
            <label>
                Upload File:
                <input type="file" onChange={handleFileChange} />
            </label>

            <label>
                Parameter 1:
                <input placeholder="Enter value for Param 1" value={param1} onChange={(e) => setParam1(e.target.value)} />
            </label>

            <label>
                Parameter 2:
                <input placeholder="Enter value for Param 2" value={param2} onChange={(e) => setParam2(e.target.value)} />
            </label>

            <label>
                Parameter 3:
                <input placeholder="Enter value for Param 3" value={param3} onChange={(e) => setParam3(e.target.value)} />
            </label>

            <button onClick={handleSubmit}>Upload</button>

            {isLoading && <div>Loading...</div>}
            <pre className="response-box">
                <strong>Response:</strong> {response}
            </pre>
        </div>
    );
}

export default App;
